INSERT INTO `wp_posts` VALUES (1,1,'2015-08-21 16:52:23','2015-08-21 16:52:23','<ul style=\"list-style-type: circle;\">\r\n	<li>\r\n<h1>aaaaaaÕ</h1>\r\n</li>\r\n	<li>aaaaaaaa</li>\r\n</ul>\r\n<!--more-->','RIP SLYME 10thアルバム「10」リリース記念 LIVE リップ熊手- tixeeboxスマホチケットご利用方法','','publish','open','open','','ripslyme','','','2015-10-02 05:32:47','2015-10-02 05:32:47','',0,'http://wocker.dev/?p=1',0,'post','',1),(2,1,'2015-08-21 16:52:23','2015-08-21 16:52:23','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my website. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://wocker.dev/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','publish','open','open','','sample-page','','','2015-08-21 16:52:23','2015-08-21 16:52:23','',0,'http://wocker.dev/?page_id=2',0,'page','',0),(3,1,'2015-10-01 01:23:04','0000-00-00 00:00:00','','自動下書き','','auto-draft','open','open','','','','','2015-10-01 01:23:04','0000-00-00 00:00:00','',0,'http://wocker.dev/?p=3',0,'post','',0),(4,1,'2015-10-01 01:32:34','2015-10-01 01:32:34','','RIP SLYME 10thアルバム「10」リリース記念 LIVE リップ熊手- tixeeboxスマホチケットご利用方法','','inherit','closed','closed','','1-revision-v1','','','2015-10-01 01:32:34','2015-10-01 01:32:34','',1,'http